import React from "react";
import "./App.css";

const Header = () => {
  return (
    <div
      style={{
        display: "flex",
        justifyContent: "center",
        alignItems: "center",
        fontSize: "30px",
        backgroundColor: "green"
      }}
    >
      <h3>Book List App</h3>
    </div>
  );
};

class BookList extends React.Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div className="main">
        <div className="main-headers">
          <p>Title</p>
          <p>Author</p>
          <p>ISBN</p>
          <p>READ?</p>
        </div>

        <div className="main-books"></div>

        <div className="main-inputs">
          <input type="text" placeholder="title" id="title"></input>
          <input type="text" placeholder="author" id="author"></input>
          <input type="text" placeholder="isbn" id="isbn"></input>
          <input type="checkbox" id="status"></input>
          <button id="submit-button" onClick={this.props.example}>
            ADD
          </button>
        </div>
      </div>
    );
  }
}

class App extends React.Component {
  constructor() {
    super();

    this.state = {
      modalOn: false
    };
  }

  example = () => {
    console.log(this);
    this.state.modalOn = true;
  };

  render() {
    return <AddBook />;
  }
}

export default App;
